import React from 'react'
import { cabeceraStyle } from '../styles/styles'

const Cabecera = ({productos}) => {
    return (
        <cabeceraStyle>
            <h1>Carrito de compras</h1>
            <p>Cantidad de productos: <span>{productos}</span></p> 
        </cabeceraStyle>
    )
}

export default Cabecera;
